  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115158 includes biological,
  chemical, discrete sample, physical and profile data collected from L'ATALANTE in
  the North Atlantic Ocean and South Atlantic Ocean from 1993-02-13 to 1993-03-19
  and retrieved during cruise WOCE_A06. These data include ALKALINITY, ARGON, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), CHLOROPHYLL A, DELTA HELIUM-3, DISSOLVED
  INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, Methane, NITRATE,
  NITRITE, NITROGEN, PHAEOPHYTIN, PHOSPHATE, Partial pressure (or fugacity) of carbon
  dioxide, Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen isotope),
  WATER TEMPERATURE and pH. The instruments used to collect these data include CTD
  and bottle. These data were collected by Claude Oudot of Centre ORSTOM as part of
  the WOCE_A06 data set.nnThe World Ocean Circulation Experiment (WOCE) was a major
  component of the World Climate Research Program with the overall goal of better
  understanding the ocean's role in climate and climatic changes resulting from both
  natural and anthropogenic causes. The CO2 survey took advantage of the sampling
  opportunities provided by the WOCE Hydrographic Program (WHP) cruises during this
  period between 1990 and 1998. The final collection covers approximately 23,000 stations
  from 94 WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
